import React from 'react';

const BookingHistory = () => {
  const bookings = [
    {
      id: 1001,
      customerName: 'John Doe',
      vehicleNumber: 'ABC-123',
      parkingLotNumber: 'Lot 3',
      dateAndTime: '2023-04-10 09:30 AM',
    },
    {
      id: 1002,
      customerName: 'Jane Smith',
      vehicleNumber: 'DEF-456',
      parkingLotNumber: 'Lot 1',
      dateAndTime: '2023-04-12 02:00 PM',
    },
    {
      id: 1003,
      customerName: 'Bob Johnson',
      vehicleNumber: 'GHI-789',
      parkingLotNumber: 'Lot 2',
      dateAndTime: '2023-04-14 10:15 AM',
    },
    // Add more booking objects as needed
  ];

  return (
    <div>
      <h1>Parking Book Booking History</h1>
      <table>
        <thead>
          <tr>
            <th>Booking ID</th>
            <th>Customer Name</th>
            <th>Vehicle Number</th>
            <th>Parking Lot Number</th>
            <th>Date and Time of Booking</th>
          </tr>
        </thead>
        <tbody>
          {bookings.map((booking) => (
            <tr key={booking.id}>
              <td>{booking.id}</td>
              <td>{booking.customerName}</td>
              <td>{booking.vehicleNumber}</td>
              <td>{booking.parkingLotNumber}</td>
              <td>{booking.dateAndTime}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default BookingHistory;
